function create_hovercraft(verts, tris, x, y, z, mx, my, mz, ax,ay,az)
    local hovercraft = create_object3d(verts, tris, x, y, z, mx, my, mz, ax,ay,az)

    hovercraft.thruster_strength = -0.2
    hovercraft.thruster_size = 0
    hovercraft.thruster_timer = 0
end


