function create_object3d_string(v_string, f_string, m_string,x,y,z,ax,ay,az, resize)
	local mx,my,mz = return_midpoint_string(m_string, resize)
    verts = return_verts_string(v_string, resize)
	tris = return_tris_string(f_string)

	return create_object3d(verts, tris, x,y,z, mx, my, mz, ax,ay,az)
end

function create_terrain_string(v_string)
    local splode_hex = explode64(v_string, ",")
    
    integer_list = store_rle(splode_hex)
end

function return_midpoint_string(string, resize)
    local splode_hex = explode_hex(string, ",")
    return splode_hex[1]*resize, splode_hex[2]*resize, splode_hex[3]*resize 
end

function return_verts_string(string, resize)
    local verts = {}
    local splode_hex = explode_hex(string, ",")
    for i=1, #splode_hex, 3 do
        local vert = {}
        vert[1] = splode_hex[i] * resize
        vert[2] = splode_hex[i+1] * resize
        vert[3] = splode_hex[i+2] * -1 * resize
        add(verts, vert)
    end
    --stop()
	--print(verts[1][1])
    return verts
end

function return_tris_string(string)
    local tris = {}
    local splode_hex = explode_hex(string, ",")
    --print(string)
    for i=1, #splode_hex, 4 do
        local tri = {}
        tri[1] =  splode_hex[i]
        tri[2] = splode_hex[i+1]
        tri[3] = splode_hex[i+2]
        tri[4] = splode_hex[i+3]
        add (tris, tri)
    end
    return tris
end

